// CameraFeeds.js
import React from 'react';
import CameraPlayer from './CameraPlayer';

const cameraUrls = [
  'https://gatewatcher.dopple.site/camera_front',
  'https://gatewatcher.dopple.site/camera_back',
  'https://xxx',
  'https://xx',
  'https://xxx',
];

const CameraFeeds = () => {
  const activeCameras = cameraUrls.slice(0, 6);

  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '10px' }}>
      <h3 style={{ textAlign: 'center', margin: '10px 0' }}>Camera Feeds</h3>
      <div style={{ display: 'flex', flexWrap: 'wrap', justifyContent: 'center', gap: '10px', padding: '5px' }}>
        {activeCameras.map((url, index) => (
          <CameraPlayer key={index} url={url} />
        ))}
      </div>
    </div>
  );
};

export default CameraFeeds;
